window.bookSummaryJSON = "<p>Jack is violently pulled into a game-like universe and dumped into a seaside town on the brink of destruction. When the people of Blackmoor Cove begin to ask about his combat role, Jack discovers his odd Hero Class and finds that parts of his game interface are riddled with exposed coding errors. </p> <p>He quickly learns that the only way the town can grow and push back the unknown substance threatening to consume it is if brave Heroes venture into an infinitely high, ever-changing tower, kill bizarre monsters for their valuable equipment drops, and then deposit those items into a special chest. </p> <p>As Jack struggles to level up and help save the people he has grown to care for, he learns the true nature of this simulated world and his destiny.... But can he overcome his reckless nature and become the leader this strange world needs? </p> <p>This “crunchy” GameLIT/LitRPG story contains: item-based game mechanics, town building, countless unique monsters, boss fights, and cheaty special abilities.</p>"; 
